script: |
  super -f text -I q2156.spq | sort > q2156.out

inputs:
  - name: q2156.spq
    data: |
      SELECT ALL - - 33 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 50 * + + col2 * - 46 NOT BETWEEN + col1 * + col2 + - + 14 * - + col2 AND - col0 + - 22;
  - name: tab1

outputs:
  - name: q2156.out
    data: |
